double f_bias = -180.0;

bool Mono_F5::init (const vector<string> &params){

  if (params.size() != 1) {
    cerr << "Error in init: Number of variables must be indicated" << endl;
    exit(-1);
  }
	
  setNumberOfVar(atoi(params[0].c_str()));
	setNumberOfObj(NOBJ);
	return true;
}

// Evaluacion
void Mono_F5::evaluate (void) {
  long double z;
  long double F1 = 0;
  long double F2 = 1;
  for(int i = 0; i < getNumberOfVar(); i++) {       
      z = getVar(i) - griewank[i];
      F1 = F1 + (pow(z, 2) / 4000);
      F2 = F2 * (cos(z / sqrt(i + 1)));
  }
  setObj(0, F1 - F2 + 1 + f_bias);
}

// Clonacion
Individual* Mono_F5::clone (void) const{
	return new Mono_F5();
}
